import React from "react";


const Receipt = ({ receipt }) => {
  return (
    <div className='receipt'>
      <h2>{receipt.person}</h2>
      <h5><span className='purple'>Main: </span>{receipt.order.main}</h5>
      <h5><span className='purple'>Protein: </span>{receipt.order.protein}</h5>
      <h5><span className='purple'>Rice: </span>{receipt.order.rice}</h5>
      <h5><span className='purple'>Sauce: </span>{receipt.order.sauce}</h5>
      <h5><span className='purple'>Drink: </span>{receipt.order.drink}</h5>
      <h5><span className='purple'>Cost: </span>${receipt.order.cost}</h5>
    </div>
  );
};

export default Receipt;
